cogvlm:
The picture shows the text "The Twelve Days of Christmas" written in English.

On the first day, they gave me a partridge in a pear tree;
On the second day, they gave me two turtles dozing;
On the third day, they gave me three French hens,
And a cow in a cowhouse, making it four.
On the fifth day, they gave me five golden rings;
On the sixth day, they gave me six geese a-laying;
On the seventh day, they gave me seven swans a-swimming;
On the eighth day, they gave me eight maids milking;
On the ninth day, they gave me nine ladies dancing;
On the tenth day, they gave me ten lords a-leaping;
On the eleventh day, they gave me eleven pipers playing;
On the twelfth day, they gave me twelve drummers drumming,
With my heart all aglow, and I felt like singing.

